if $0 == __FILE__
  parser = CParser.new

  handler = proc { |extdecl|
    p extdecl.cstr
  }
  if ARGV.empty? then
    parser.parse(STDIN, :on_extdecl => handler)
  else
    for file in ARGV
      fp = File.open(file)
      parser.parse(fp, :on_extdecl => handler)
      fp.close
    end
  end
end
